import './App.css';
import { Route, Switch } from "react-router-dom";
import Home from './Components/Home';
import NavBar from './Components/NavBar';
import MyDecks from './Components/MyDecks';
import DeckBuilder from './Components/DeckBuilder';

function App() {
  return (
    <div>
    <NavBar/>
    <Switch>
      <Route exact path="./Components/DeckBuilder">
        <DeckBuilder/>
      </Route>
      <Route exact path="./Components/MyDecks">
        <MyDecks/>
      </Route>
      <Route exact path="./">
        <Home/>
      </Route>
    </Switch>
    </div>
  );
}

export default App;
